import { createRouter } from '../../../bundle';
const Correcting = createRouter({
	load: () =>
		import('../container/correcting')
});

const CommonIndex = createRouter({
	load: () =>
		import('../container/index')
});


export default {
	title: '作业',
	path: '/',
	routers:[{
		title: 'zuoye',
		path: '/zuoye',
		component: CommonIndex,
	},
	{
		title: 'a',
		path: '/a',
		component: Correcting,
	}
	]
}
